 &lt;a href=&quot;http://img836.imageshack.us/img836/9774/newkidsu.jpg&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;http://img836.imageshack.us/img836/9774/newkidsu.jpg&lt;/a&gt;


Nederland
Actie / Komedie
78 minuten

geregisseerd door Steffen Haars en Flip van der Kuil
met Huub Smit, Tim Haars en Wesley van Gaalen

Friesland wordt getroffen door een zombieplaag, maar in Maaskantje hebben Richard, Rikkert, Gerrie, Robbie en Barrie andere dingen aan hun hoofd. Ze zijn in oorlog met het nabij gelegen Brabantse dorpje Schijndel. Dit leidt tot illegale straatraces en massale vechtpartijen. Als de Friese zombies een Brabants slachtoffer maken, moeten de twee groepen hun krachten bundelen om het grotere kwaad te trotseren.




Dit is beste wat ik er van kon maken, vanaf 30 min. zie je ongeveer 15 min zwart beeld (wel gewoon audio) en daarna zie je de helft nog maar, alleen de moeite waard als je hem echt wilt zien! (Zie screenshots)

Thanks to degene die hem heeft gefilmd, respect voor hem.





